import React from 'react';
import styled from 'styled-components';
import Input from '../conponents/Input.js';
import Button from '../conponents/Button.js';

const Wrapper = styled.div`
    width: 500px;
    border: 1px solid ;
    height: 350px;
    margin-left: 470px;
    margin-top: 50px;
    border-radius: .25rem;
`
const Btn_input = styled.div`
    margin-top: 30px;
    margin-left: 8px;
`
const FormTest = ({
    email,
    pwd,
    phone,
    onChange,
    onSubmit,

}) => (
    <Wrapper>
        <Btn_input>
            <Input
                label = "Email:"
                onChange = {onChange}
                placeholder={" your Email"}
            />
            <Input
                label = "Password:"
                onChange = {pwd}
                placeholder={" your Password"}
            />
            <Input
                label = "Phone:"
                onChange = {phone}
                placeholder={" your Phone"}
            />
            <Button 
             name="Resinger"
             onClick = {onSubmit}

            />
        </Btn_input>
    </Wrapper>

)

class From extends React.Component {
    constructor(props) {
        super(props);

    }

    onChange = (e , name) => {
        console.log(name)
        console.log(e.target.value)

    }

    onSubmit = () =>  {
        console.log("Resinger Sussion")
    }

render() {
    return(
        <FormTest
        onSubmit = {this.onSubmit}
        onChange={this.onChange}
        // onChangeEmail = {this.onChange(e , 'email')}       
        // onChangePwd = {e => this.onChange(e , 'pwd')}       
        // onChangePhone = {e => this.onChange(e , 'Phone')} 
        />

    )
}
}

export default From;
